import React, { Component } from 'react';
import WeatherLocation from './components/WeatherLocation';
import './App.css';

class App extends Component {
  render() {
    return (
        <div className="App">
            <WeatherLocation></WeatherLocation>
      </div>
    );
  }
}

ReactDOM.render(<App />, document.querySelector('#app'));

